import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import "./Theme.css";
const theme={
    name:"Theme",
    icon:"tshirt"
}
function Theme() {
    return (
      <>
          <FontAwesomeIcon className={theme.name} icon={theme.icon}/>
      </>
    );
  }
  

export default Theme;
